INSERT INTO `noticias` (`id_noticia`, `titulo_noticia`, `texto_noticia`, `imagem_noticia`, `data_criacao`) VALUES
(1, '🐝 Estudo da Abepoli Revela Abelhas no Mar de Girassóis', 'Brasília, 29 de maio de 2025 — Um estudo inédito divulgado nesta semana pela Abepoli (Associação Brasileira de Estudos Polinizadores) revelou a presença massiva e organizada de abelhas silvestres em uma extensa plantação de girassóis no interior de Goiás, apelidada pelos pesquisadores de \"Mar de Girassóis\".', 'WhatsApp Image 2025-04-28 at 15.33.38 (2).jpeg', '2025-06-01 19:52:37'),
(2, '🐝 Como Todos Podem Ajudar a Salvar as Abelhas', '✅ Plante flores – Girassóis, lavandas e margaridas atraem e alimentam abelhas.\r\n🚫 Evite agrotóxicos – Produtos químicos prejudicam as abelhas. Prefira opções naturais.\r\n🏡 Crie abrigos simples – Pequenos hotéis de insetos ou toquinhos de madeira com furos servem de lar para espécies nativas.', 'WhatsApp Image 2025-04-28 at 15.33.38 (1).jpeg', '2025-06-01 19:53:45'),
(3, '🌱 Abepoli e SESI Firmam Parceria pela Educação Ambiental', 'A Abepoli e o SESI anunciaram uma nova parceria para levar educação ambiental a escolas de todo o país. O projeto inclui oficinas sobre polinização, hortas escolares e a importância das abelhas para o meio ambiente.\r\nA iniciativa deve alcançar mais de 50 mil alunos já em 2025.', 'IMG_20250318_092708.jpg', '2025-06-01 21:39:58');

